import React, { useEffect, useRef, useState } from 'react';
import { io } from 'socket.io-client';
import { useAuthStore } from '../stores/authStore';

function CameraView() {
  const videoRef = useRef(null);
  const [isConnected, setIsConnected] = useState(false);
  const [error, setError] = useState(null);
  const [detectedItems, setDetectedItems] = useState([]);
  const socketRef = useRef(null);
  const { isAuthenticated } = useAuthStore();

  useEffect(() => {
    if (!isAuthenticated) return;

    // Connect to WebSocket server with proper configuration
    socketRef.current = io('http://localhost:5000', {
      path: '/socket.io',
      transports: ['websocket'],
      upgrade: false,
      reconnection: true,
      reconnectionAttempts: 5,
      reconnectionDelay: 1000,
      withCredentials: true,
      extraHeaders: {
        'Access-Control-Allow-Origin': 'http://localhost:3000'
      }
    });

    // Handle connection events
    socketRef.current.on('connect', () => {
      console.log('Connected to camera stream');
      setIsConnected(true);
      setError(null);
    });

    socketRef.current.on('connect_error', (error) => {
      console.error('Connection error:', error);
      setError('Failed to connect to camera stream');
      setIsConnected(false);
    });

    socketRef.current.on('disconnect', () => {
      console.log('Disconnected from camera stream');
      setIsConnected(false);
    });

    // Handle incoming processed frames
    socketRef.current.on('processed_frame', (data) => {
      if (videoRef.current) {
        // Convert binary frame data to blob URL
        const blob = new Blob([data.frame], { type: 'image/jpeg' });
        const imageUrl = URL.createObjectURL(blob);
        
        // Update video source
        videoRef.current.src = imageUrl;
        
        // Update detected items if available
        if (data.detected_items) {
          setDetectedItems(data.detected_items);
        }
        
        // Clean up blob URL
        URL.revokeObjectURL(imageUrl);
      }
    });

    socketRef.current.on('error', (error) => {
      console.error('Camera stream error:', error);
      setError(error.message);
    });

    // Cleanup on unmount
    return () => {
      if (socketRef.current) {
        socketRef.current.disconnect();
      }
    };
  }, [isAuthenticated]);

  return (
    <div className="min-h-screen bg-gray-100 py-6 flex flex-col justify-center sm:py-12">
      <div className="relative py-3 sm:max-w-xl sm:mx-auto">
        <div className="relative px-4 py-10 bg-white mx-8 md:mx-0 shadow rounded-3xl sm:p-10">
          <div className="max-w-md mx-auto">
            <div className="divide-y divide-gray-200">
              <div className="py-8 text-base leading-6 space-y-4 text-gray-700 sm:text-lg sm:leading-7">
                <h2 className="text-2xl font-bold mb-4">Smart Cart Camera</h2>
                
                {error && (
                  <div className="bg-red-50 p-4 rounded-md mb-4">
                    <p className="text-red-700">{error}</p>
                  </div>
                )}

                <div className="relative">
                  <img
                    ref={videoRef}
                    className="w-full h-auto rounded-lg shadow-lg"
                    alt="Camera Stream"
                  />
                  
                  {!isConnected && (
                    <div className="absolute inset-0 flex items-center justify-center bg-gray-900 bg-opacity-50 rounded-lg">
                      <p className="text-white">Connecting to camera...</p>
                    </div>
                  )}
                </div>

                {detectedItems.length > 0 && (
                  <div className="mt-4">
                    <h3 className="text-lg font-semibold mb-2">Detected Items:</h3>
                    <ul className="space-y-2">
                      {detectedItems.map((item, index) => (
                        <li key={index} className="flex items-center space-x-2">
                          <span className="w-4 h-4 bg-green-500 rounded-full"></span>
                          <span>{item.name} - {item.confidence}%</span>
                        </li>
                      ))}
                    </ul>
                  </div>
                )}
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default CameraView;
